// components/Analytics.js
import React from "react";
import StockChart from "./StockChart";

const Analytics = ({ books }) => {
  return (
    <div className="page">
      <h1>Analytics</h1>
      <StockChart books={books} />
    </div>
  );
};

export default Analytics;
